import "./App.css";
import { Route } from "react-router-dom";
import HomePage from "./pages/homepage/homepage.component.jsx";

const HatsPage = () => (
  <div>
    <h1>HATS PAGE</h1>
  </div>
);

function App() {
  return (
    <div>
      <Route component={HatsPage}>{HatsPage}</Route>
    </div>
  );
}

export default App;
